import logo from './logo.svg';
import './App.css';

function App() {
  return <Routes>
    <Route path='/' element={<LoginPage setIsLoggedIn={setIsLoggedIn}/>} />
    <Route path='/SignUp' element={<SignUpPage />} />
    <Route path='/Home' element={<HomePage isLoggedIn={isLoggedIn} setUserInfo={setUserInfo} userInfo={userInfo}/>} />
    <Route path='/CheckIn' element={<VenueCheckIn />} />
    <Route path='/Countdown' element={<IsolationCountdown userInfo={userInfo}/>} />
    <Route path='/BookTest' element={<TestBooking />} />
    <Route path='/SymptomSurvey' element={<SymptomSurvey />} />
    <Route path='/MessagingService' element={<MessagingService />} />
    <Route path='/ProfilePage' element={<ProfilePage userInfo={userInfo}/>} />
  </Routes>
}


export default App;
